import{_ as a,c as t,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const E=JSON.parse('{"title":"DROP EXTERNAL TABLE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_EXTERNAL_TABLE.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_EXTERNAL_TABLE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_EXTERNAL_TABLE.md"};function n(l,e,r,d,p,c){return s(),t("div",null,e[0]||(e[0]=[o('<h1 id="drop-external-table" tabindex="-1">DROP EXTERNAL TABLE <a class="header-anchor" href="#drop-external-table" aria-label="Permalink to &quot;DROP EXTERNAL TABLE&quot;">​</a></h1><p>Removes an external table definition.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP EXTERNAL [WEB] TABLE [IF EXISTS] &lt;name&gt; [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP EXTERNAL TABLE</code> drops an existing external table definition from the database system. The external data sources or files are not deleted. To run this command you must be the owner of the external table.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>WEB : Optional keyword for dropping external web tables.</p><p>IF EXISTS : Do not throw an error if the external table does not exist. WarehousePG issues a notice in this case.</p><p>name : The name (optionally schema-qualified) of an existing external table.</p><p>CASCADE : Automatically drop objects that depend on the external table (such as views).</p><p>RESTRICT : Refuse to drop the external table if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the external table named <code>staging</code> if it exists:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP EXTERNAL TABLE IF EXISTS staging;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>DROP EXTERNAL TABLE</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_EXTERNAL_TABLE.html">CREATE EXTERNAL TABLE</a>, <a href="./ALTER_EXTERNAL_TABLE.html">ALTER EXTERNAL TABLE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',20)]))}const m=a(i,[["render",n]]);export{E as __pageData,m as default};
